import React, { Component } from "react";
import { Container, Row, Col } from "reactstrap";
import Asya from "../assets/pictures/asyam.jpg";
import Kaelen from "../assets/pictures/kaelen.png";
import "../styles/Contact.scss";

class Contact extends Component {
  state = { 
    showing1: false,
    showing2: false,
    showing3: false,
    showing4: false,
    showing5: false,
    showing6: false
  };

  render() {
    const { showing1, showing2, showing3, showing4, showing5, showing6 } = this.state;

    return (
      <div id="Contact">
        <Container>
          <Row>
            <Col class="col">
              <div
                class="div"
                onClick={() => this.setState({ showing1: !showing1 })}
              >
                {/* <img src={} /> */}
                <div
                  class="div-click"
                  style={{ display: showing1 ? "block" : "none" }}
                >
                  {/* <p>Role <br/>  */}
                  <p>About</p>
                  {/* link to linkedIn */}
                </div>
              </div>
              <h3>Aditi</h3>
            </Col>
            <Col class="col">
              <div
                class="div"
                onClick={() => this.setState({ showing2: !showing2 })}
              >
                {/* <img src={} /> */}
                <div
                  class="div-click"
                  style={{ display: showing2 ? "block" : "none" }}
                >
                  {/* <p>Role <br/>  */}
                  <p>Kaaya is a first year Computer Science major at the University of Texas.
Interested in cybersecurity, data, and web technologies.
</p>
                  {/* link to linkedIn */}
                </div>
              </div>
              <h3>Kaaya</h3>
            </Col>
            <Col class="col">
              <div
                class="div"
                onClick={() => this.setState({ showing3: !showing3 })}
              >
                {/* <img src={} /> */}
                <div
                  class="div-click"
                  style={{ display: showing3 ? "block" : "none" }}
                >
                  {/* <p>Role <br/>  */}
                  <p>Terry is a freshman studying Aerospace Engineering at the
              University if Texas.
              <a href="https://instagram.com/phetsouvanh" class="social" target="_blank"
              ><i class="fab fa-instagram" aria-hidden="true"></i
            ></a>
              www.linkedin.com/in/terry-murray-478b0b1ba</p>
                  {/* link to linkedIn */}
                </div>
              </div>
              <h3>Terry</h3>
            </Col>
          </Row>
          <Row>
            <Col class="col">
              <div
                class="div"
                onClick={() => this.setState({ showing4: !showing4 })}
              >
                <img src={ Asya } />
                <div
                  class="div-click"
                  style={{ display: showing4 ? "block" : "none" }}
                >
                  {/* <p>Role <br/>  */}
                  <p>Asya is a graduating senior at the University of Texas.</p>
                  {/* link to linkedIn */}
                </div>
              </div>
              <h3>Asya</h3>
            </Col>
            <Col class="col">
              <div
                class="div"
                onClick={() => this.setState({ showing5: !showing5 })}
              >
                {/* <img src={} /> */}
                <div
                  class="div-click"
                  style={{ display: showing5 ? "block" : "none" }}
                >
                 {/* <p>Role <br/>  */}
                 <p>About</p>
                  {/* link to linkedIn */}
                </div>
              </div>
              <h3>Sebastian</h3>
            </Col>
            <Col class="col">
              <div
                class="div"
                onClick={() => this.setState({ showing6: !showing6 })}
              >
                <img src={ Kaelen } />
                <div
                  class="div-click"
                  style={{ display: showing6 ? "block" : "none" }}
                >
                  {/* <p>Role <br/>  */}
                  <p>Kaelen is a third year Mathematics major at the University of Texas. 
Interested in data, accessible web technologies, UI/UX design, and environmental sustainability.
Website: https://kaelensayth.me/
LinkedIn: https://www.linkedin.com/in/kaelensayth/
</p>
                  {/* link to linkedIn */}
                </div>
              </div>
              <h3>Kaelen</h3>
            </Col>
          </Row>
        </Container>
      </div>
    );
  }
}

export default Contact;
